import React from "react";

import "./styles.scss";

import image from "../../assets/Artboard 1.jpg";

const Success = () => {
  return (
    <div className="success-container">
      <img src={`${image}`} alt="logo" className="logo" />
      <div className="welcome-admit-text">
        <h1>Welcome to AdmitKard</h1>
        <p>
          In order to provide you with a custom experience, we need to ask you a
          few questions.
        </p>
      </div>
      <button className="submit-button">Sign In with OTP</button>
      <p>*This will only take 5 min.</p>
    </div>
  );
};

export default Success;
